import React, { Component } from "react";
import "./navbar.css";

class Navabr extends Component {
  state = {};
  render() {
    return (
      <ul className="nav-ul">
        <li onClick={this.props.onChangePanel('domestic')}>Domestic</li>
        <li onClick={this.props.onChangePanel}>Wild</li>
        <li onClick={this.props.onChangePanel}>Birds</li>
      </ul>
    );
  }


}

export default Navabr;
